import React,{useState,useEffect} from 'react';


export default function UserCard({iconURL,title,content}){

    //

    return(
        <div class="sw-title text-md-left text-left">

        <img src={iconURL} className="u-icon u-icon--lg u-icon-secondary--air rounded-circle"/>

        <h3 class="sw-heading-alt sw-heading-alt-3 mb-2">
          {title}
        </h3>

        <div class="">
          <p>{content}</p>        
        </div>

      </div>
    )
}
